import React from 'react';

const Search = () => {
    return (
        <div>
            <div>
            <input type="text" placeholder="검색어를 입력해주세요." className="search"></input>ㅤㅤ
            <button className='search-btn'>검색</button>
            </div>

        </div>
    );
};

export default Search;
